import React from 'react';
import StepComponent from './StepComponent';
import { Button, Col,Row } from 'antd'
const ContentComponent = () => {
    return (
        <div className="container">
            <StepComponent/>
            <Col span={6}>
                <Button className="btn-click">
                    Click Button
                </Button>
            </Col>
        </div>
    );
}

export default ContentComponent;
